script: |
  super -f text -I q3303.spq | sort > q3303.out

inputs:
  - name: q3303.spq
    data: |
      SELECT DISTINCT + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE - col0 = + col0 - col1 + col0 AND NULL NOT BETWEEN col0 + col1 AND ( ( - CAST ( + col1 AS INTEGER ) ) );
  - name: tab1

outputs:
  - name: q3303.out
    data: |
